import React from 'react';
import './home.css';
import Jumbotron from '../../components/jumbotron/jumbotron';
import Header from '../../components/header/header';

document.body.classList.add('home-page');

function Home() {
  return (
    <>
      <Header />
      <Jumbotron />
    </>
  );
}

export default Home;
